import React from 'react'

function App() {
  return (
    <div style={{ margin:10 , marginleft:20 }}>
      <label htmlFor="fname"><b>FIRST NAME : </b></label>
      <input type="text" name='fname' placeholder='Enter Your First Name' /><br />
      <label htmlFor="fname"><b>MIDDLE NAME : </b></label>
      <input type="text" name='mname' placeholder='Enter Your middle Name' /><br />
      <label htmlFor="fname"><b>LAST NAME : </b></label>
      <input type="text" name='lname' placeholder='Enter Your last Name' /><br />
      <button style={{margin:5,marginLeft:90 , color:red }}>Button</button>
    </div>
  )
}
export default App;
